import React from "react";
import Avatar from "@material-ui/core/Avatar";
import Button from "@material-ui/core/Button";
import Container from "@material-ui/core/Container";
import TextField from "@material-ui/core/TextField";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import Link from "@material-ui/core/Link";
import Paper from "@material-ui/core/Paper";
import Hidden from "@material-ui/core/Hidden";
import withWidth from "@material-ui/core/withWidth";
import Toolbar from "@material-ui/core/Toolbar";
import Box from "@material-ui/core/Box";
import Grid from "@material-ui/core/Grid";
import AppBar from "@material-ui/core/AppBar";
import LockOutlinedIcon from "@material-ui/icons/LockOutlined";
import Typography from "@material-ui/core/Typography";
import { makeStyles } from "@material-ui/core/styles";
import { spacing } from "@material-ui/system";

import ReactDOM from "react-dom";
import GoogleLogin from "react-google-login";

function Contact() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      <Link color="inherit" href="https://material-ui.com/">
        Contact Me
      </Link>
    </Typography>
  );
}

const useStyles = makeStyles(theme => ({
  root: {
    height: "100vh",
    flexGrow: 1
  },
  container: {},
  image: {
    backgroundImage: "url(./logo.png)",
    backgroundRepeat: "no-repeat",
    backgroundSize: "contain",
    backgroundPosition: "center"
  },
  item: {
    height: "660px",
    padding: theme.spacing(2),
    textAlign: "center"
  },
  bar: {
    marginTop: "500px"
  },
  miniBar: {
    top: "auto",
    bottom: 0
  }
}));

function loginButtons() {
  return (
    <GoogleLogin
      clientId="472983817080-fdu8q9rhdr5bdnp8v68p0eaq4u7e6lgh.apps.googleusercontent.com"
      buttonText="Login with Google"
      onSuccess={responseGoogle}
      onFailure={responseGoogle}
      cookiePolicy={"single_host_origin"}
    />
  );
}

const responseGoogle = response => {
  console.log(response);
  // first one
  // 1064855146728-dhtpjoavv0bohmus2aovdlvljk55ap42.apps.googleusercontent.com

  // second one
  // secret: 4m4EqqJqIoifGpKpoDGYDdCH
};

export default function SignInSide() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid
        container
        justify="center"
        alignItems="center"
        direction="column"
        spacing={3}
        className={classes.container}
      >
        <Hidden xsDown>
          <Grid item xs={12} sm={8}>
            <Paper elevation={6} className={classes.item}>
              <Box className={classes.image} />
            </Paper>
            <Hidden xsDown>
              <Paper elevation={6}>{loginButtons()}</Paper>
            </Hidden>
          </Grid>
        </Hidden>
        <Hidden smUp>
          <AppBar position="fixed" color="primary" className={classes.miniBar}>
            <Toolbar>{loginButtons()}</Toolbar>
          </AppBar>
        </Hidden>
      </Grid>
    </div>
  );
}
